export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"667zb7DSTF":{data:{id:2242,attributes:{imdbId:"tt0153464",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTU1MzIzNzAwMF5BMl5BanBnXkFtZTcwODAxODAwMQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Rotten Tomatoes",Value:"45%"},{Source:"Metacritic",Value:"57\u002F100"}],item_lang:{data:{id:2905,attributes:{title:e,plot:"Superficial people are revealed and drastically changed by circumstance or luck in this tale of death, seduction, blackmail, and theft amongst British and Americans in Florence, Italy in the turbulent days just before World War II.",slug:"up-at-the-villa"}}},books:{data:[{id:10972,attributes:{title:e,description:f,thumbnail:g,authors:[b],firstBook:true,published:h,publisher:c,subtitle:a}},{id:10973,attributes:{title:e,description:f,thumbnail:g,authors:[b],firstBook:d,published:h,publisher:c,subtitle:a}},{id:10974,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:d,published:l,publisher:c,subtitle:a}},{id:10975,attributes:{title:"Leben und Werk",description:"Klaus W. Jonas' zweisprachige Ausgabe behandelt die literarische Laufbahn des Schriftstellers W. Somerset Maugham (1874-1965), eines der erfolgreichsten und meistgelesenen englischen Dramatiker, Essayisten und Romanciers der ersten Halfte des 20. Jahrhunderts. Maugham selbst hat das humorvolle Vorwort in der Form eines Briefes beigesteuert. Eine chronologische Darstellung seines Lebens wird erganzt durch zwei wissenschaftliche Essays des Verfassers zu Maughams umfassendem literarischen Schaffen. Von besonderem Interesse sind die Auszuge aus dem Briefwechsel zwischen Klaus W. Jonas und W. Somerset Maugham, die einen genaueren Einblick in die Personlichkeit des Schriftstellers erlauben und von der engen Vertrautheit der beiden Briefpartner zeugen. Den zweiten Teil der Ausgabe bilden eine ausfuhrliche Bibliographie von Maughams literarischem Schaffen sowie eine Auswahlbibliographie von mehr als 420 kritischen Studien in deutscher, englischer, japanischer, spanischer und franzosischer Sprache. 71 Abbildungen, viele von ihnen bisher unveroffentlicht und aus Privatbesitz, erhohen den dokumentarischen Wert dieses Bandes. In this bilingual edition the author attempts to trace the literary career of William Somerset Maugham (1874-1865), one of the most widely read and performed dramatists, essayists and novelists in English literature in the first half of the twentieth century. Maugham himself has contributed a humorous preface in the form of a letter addressed to the author. The detailed chronology of Maugham's life is being supplemented by two of the author's numerous essays dealing with the stupendous literary oeuvre of this writer. Of special interest are the excerpts from Maugham's letters to his German-born collector and biographer which provide an inside view into his personality and his friendship with Klaus W. Jonas. The second half of this volume contains a bibliographical record of Maugham's life-work and a select bibliography of 420 critical studies in German, English, French, Spanish and Japanese. 71 illustrations, many of which hitherto unpublished and privately owned, enhance the documentary value of this volume.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dV5BeXacNxQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Klaus W. Jonas"],firstBook:d,published:"2009-01-01",publisher:"Otto Harrassowitz Verlag",subtitle:a}},{id:10976,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:d,published:l,publisher:c,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940933247}}("","W. Somerset Maugham","Vintage",null,"Up at the Villa","Now a major motion picture from USA Films starring Kristin Scott Thomas and Sean Penn, and director Philip Haas (director of Angels and Insects). In Up at the Villa, W. Somerset Maugham portrays a wealthy young English woman who finds herself confronted rather brutally by the repercussions of whimsy. On the day her older and prosperous friend asks her to marry him, Mary Leonard demurs and decides to postpone her reply a few days. But driving into the hills above Florence alone that evening, Mary offers a ride to a handsome stranger. And suddenly, her life is utterly, irrevocably altered. For this stranger is a refugee of war, and he harbors more than one form of passion. Before morning, Mary will witness bloodshed, she will be forced to seek advice and assistance from an unsavory man, and she will have to face the truth about her own yearnings. Erotic, haunting, and maddeningly suspenseful, Up at the Villa is a masterful tale of temptation and the capricious nature of fate.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=IhXUad9pwAwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-08-17","Rain","A Vintage Shorts “Short Story Month” Selection While stranded waiting for their ship to be released from quarantine, Dr. and Mrs. Macphail must share lodging with the insufferable Davidsons—self-righteous and over-zealous missionaries who also happen to be the only polite company on the god-forsaken island near Pago-Pago. But, things take a dreadful and unexpected turn when Mr. Davidson takes it upon himself to rescue the soul of their neighbor downstairs from second cabin—the insolent, carousing, and inimitable Miss Sadie Thompson. Harrowing and triumphant, “Rain” is indispensable reading, a foundational work for the tradition of short story writing, and one of W. Somerset Maugham’s greatest tales. An ebook short.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=elPgCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2016-05-19"))